import * as atoms from "./components/atoms";
import * as molecules from "./components/molecules";
const { SubmitButton } = atoms;
const {
  Checkbox,
  CvrSearch,
  MultiSelect,
  RadioGroup,
  SelectField,
  Textarea,
  TextInput,
} = molecules;
export {
  //Atoms
  SubmitButton,
  //Molecules
  Checkbox,
  CvrSearch,
  MultiSelect,
  RadioGroup,
  SelectField,
  Textarea,
  TextInput,
};
